<?php
class Solution {

    /**
     * 2661. First Completely Painted Row or Column
     * @param Integer[] $arr
     * @param Integer[][] $mat
     * @return Integer
     */
    function firstCompleteIndex($arr, $mat): int {
        $rowCount = count($mat);
        $colCount = count($mat[0]);
        $rows = array_fill(0, $rowCount, 0);
        $cols = array_fill(0, $colCount, 0);
        
        $positions = [];
        for ($i = 0; $i < $rowCount; $i++) {
            for ($j = 0; $j < $colCount; $j++) {
                $positions[$mat[$i][$j]] = [$i, $j];
            }
        }
        print_r($positions);
        foreach ($arr as $i => $num) {
            [$row, $col] = $positions[$num];
            $rows[$row]++;
            $cols[$col]++;
            if ($rows[$row] == $colCount || $cols[$col] == $rowCount) {
                return $i; 
            }            
        }
        
        /*
        My first solution would time out. 538ms on big test.
        for ($i = 0; $i < count($arr); $i++) {
            $tmpValue = $arr[$i];     
            for ($j = 0; $j < $rowCount; $j++) {
                for ($k = 0; $k < $colCount; $k++) {
                    if ($mat[$j][$k] === $tmpValue) { 
                        $rows[$j]++;
                        $cols[$k]++;
                        if ($rows[$j] === $colCount) { return $i; }
                        if ($cols[$k] === $rowCount) { return $i; }
                        //if ($rows[$j] === $colCount || $cols[$k] === $rowCount) { return $i; }
                        //if ($tmpRow === $rowCount || $tmpCol === $colCount) { return $i; }
                        //if (in_array($colCount, $rows, true) || in_array($rowCount, $cols, true)) { return $i; }
                    }
                }
            }
        }
        */
        return 0;
    }
}

